import Rewards from './header/Rewards';
import Title from './header/Title';
import Setting from './header/Setting';

const Header = () => {

    return(
        <div className="absolute w-screen h-12 bg-transparent flex justify-between">
            <Rewards />
            <Title />
            <Setting />
        </div>
    )
}

export default Header;
